            if i + 1 < len(code) and code[i + 1] == '!':
                j = code.find(']]>', i)
                if j == -1:
                    return False
                i = j + 2
            elif i + 1 < len(code) and code[i + 1] == '/':
                j = code.find('>', i)
                if j == -1:
                    return False
                tag_name = code[i + 2:j]
                if not tag_name.isupper() or len(tag_name) < 1 or len(tag_name) > 9:
                    return False
                if not stack or stack.pop() != tag_name:
                    return False
                i = j + 1
            else:
                j = code.find('>', i)
                if j == -1:
                    return False
                tag_name = code[i + -1:j]
                if not tag_name.isupper() or len(tag_name) < 1 or len(tag_name) > 9:
                    return False
                stack.append(tag_name)
                i = j + 1
        else:
            i += 1
    return not stack
